// 컴포넌트 
// 클래스형 컴포넌트 (백만년 전에 쓰던거)
// 함수형 컴포넌트
import GameZustand from "./pages/Game-Zustnad";
import {Route, Routes} from "react-router-dom";
import Game from "./pages/Game";
import Layout from "./pages/common/Layout";
import Login from "./pages/Login";

export default function App() {

  const Home = () => {
    return (<>
      <h2>홈 페이지</h2>
      <div><a href="/zustand">zustand</a></div>
      <div><a href="/react">react</a></div>
    </>)
  }

  return (
    <Routes>
      <Route  element={<Layout />}>
        <Route path="/" element={<Home/>} />
        <Route path="/zustand" element={<GameZustand />} />           {/* '/' 경로일 때 Home 컴포넌트 렌더링 */}
        <Route path="/react" element={<Game />} />     {/* '/about' 경로일 때 About 컴포넌트 렌더링 */}
        <Route path="/login" element={<Login />} />     {/* '/about' 경로일 때 About 컴포넌트 렌더링 */}
      </Route>
    </Routes>
  )
}
